import React, { useEffect, useState } from 'react';
import API from '../utils/api';
import LoadingSpinner from '../components/LoadingSpinner';
import { FiTrash2 } from 'react-icons/fi';

export default function ChatLogs() {
  const [logs, setLogs] = useState([]);
  const [loading, setLoading] = useState(true);

  const fetchLogs = async () => {
    try {
      const res = await API.get('/api/chat_logs');
      setLogs(res.data || []);
    } catch (err) {
      console.error("Failed to fetch chat logs:", err);
    } finally {
      setLoading(false);
    }
  };
 
  useEffect(() => {
    fetchLogs();
    const interval = setInterval(fetchLogs, 10000); // Refresh every 10s
    return () => clearInterval(interval);
  }, []);

  const onDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this chat log?')) {
      try {
        await API.delete(`/api/chat_logs/${id}`);
        setLogs(logs.filter(log => log.id !== id));
      } catch (err) {
        console.error("Failed to delete chat log:", err);
      }
    }
  };

  const clearLogs = async () => {
    if (window.confirm('Are you sure you want to clear ALL chat logs?')) {
      try {
        setLoading(true);
        await API.post('/api/chat_logs/clear');
        setLogs([]);
      } catch (err) {
        console.error("Failed to clear chat logs:", err);
      } finally {
        setLoading(false);
      }
    }
  };

  const formatTime = (timestamp) => {
    try {
      return new Date(timestamp).toLocaleString();
    } catch {
      return timestamp;
    }
  };

  return (
    <div className="glass-card p-6">
      <div className="flex items-center justify-between mb-4">
        <h1 className="text-2xl font-bold">Chat Logs</h1>
        <button
          onClick={clearLogs}
          className="btn-secondary bg-red-500 hover:bg-red-600 text-white px-4 py-2 rounded"
        >
          Clear All
        </button>
      </div>
      {loading ? (
        <LoadingSpinner />
      ) : (
        <div className="overflow-x-auto max-h-[500px] custom-scroll">
          <table className="min-w-full text-sm">
            <thead>
              <tr className="bg-blue-100 dark:bg-blue-900 text-left">
                <th className="p-2">Time</th>
                <th className="p-2">Sender</th>
                <th className="p-2">Receiver</th>
                <th className="p-2">Message</th>
                <th className="p-2">Actions</th>
              </tr>
            </thead>
            <tbody>
              {logs.length === 0 ? (
                <tr>
                  <td colSpan="5" className="p-4 text-center text-gray-500">
                    No chat logs available.
                  </td>
                </tr>
              ) : (
                logs.map((log) => (
                  <tr key={log.id} className="border-b border-gray-200 dark:border-gray-700">
                    <td className="p-2 whitespace-nowrap">{formatTime(log.timestamp)}</td>
                    <td className="p-2">{log.sender}</td>
                    <td className="p-2">{log.receiver}</td>
                    <td className="p-2 break-words max-w-[300px]">{log.message}</td>
                    <td className="p-2">
                      <button
                        onClick={() => onDelete(log.id)}
                        className="p-2 rounded-full bg-red-500/80 hover:bg-red-600 text-white"
                      >
                        <FiTrash2 size={16} />
                      </button>
                    </td>
                  </tr>
                ))
              )}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
